function changeTab(element){  //設定切換

    let allOrangeJuiceByClass = document.getElementsByClassName("tab-link");

    for (let i = 0; i < allOrangeJuiceByClass.length; i++) {
      allOrangeJuiceByClass[i].classList.remove("current");
    }
      element.classList.add("current");

    let tab1 = document.getElementById("tab-1");
    let tab2 = document.getElementById("tab-2");
    let tab3 = document.getElementById("tab-3");
    let tab4 = document.getElementById("tab-4");
    tab1.classList.remove("current");
    tab2.classList.remove("current");
    tab3.classList.remove("current");
    var tab_id =element.getAttribute('data-tab')
    let tab_ = document.getElementById(tab_id);

    tab_.classList.add("current");
}




// called onclick of checkbox
function toggleSub(box) {

    let id = box.id  + '_sub';

    var el = document.getElementById(id);
    
    if ( box.checked ) {
        el.style.display = 'block';
    } else {
        el.style.display = 'none';
    }
}









